import React from 'react'
import images from '../Helpers/Images'
import { useState } from 'react'

function Carousel() {
  const [currImg, setImg] = useState(0);
  return (
    <div className='h-85'>
      <div className='h-85'
      style={{ background: `url(${images[currImg].img})`, backgroundSize: 'cover', height: '300px' }}></div>
    </div>
  )
}

export default Carousel
